// FormComponent.js
import React, { useState } from 'react';
import {
  Box, Typography, TextField, Grid, Paper, Button, Divider,TableCell,TableContainer,TableHead,Table,TableRow,TableBody
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const ApplicationFormBPT = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    // Personal Details
    adNo: '',
    adDate: '',
    applicationNo: '',
    courseName: '',
    courseCode: '',
    dateOfEntry: '',
    lastDate: '',
    department: '',
    name: '',
    fatherName: '',
    dob: '',
    age: '',
    birthPlace: '',
    status: '',
    nationality: '',
    maritalStatus: '',
    gender: '',
    differentlyAbled: '',
    idMark1: '',
    idMark2: '',
    universityArea: '',
    inService: '',
    aadhar: '',
    fatherEmail: '',
    fatherAge: '',
    fatherOccupation: '',
    motherName: '',
    motherAge: '',
    motherOccupation: '',
    monthlyIncome: '',

    // Intermediate Subjects
    botany: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: '',
      maxmarks:''
    },
    zoology: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    physics: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    chemistry: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    english: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    secondLanguage: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },

    // Totals
    overallMarks: '', overallMax: '', overallPercentage: '',
    groupMarks: '', groupMax: '', groupPercentage: '',

    // Academic History
    inter2ndYear: '', inter2ndCollege: '', inter2ndPlace: '',
    inter2ndState: '', inter2ndDistrict: '',
    inter1stYear: '', inter1stCollege: '', inter1stPlace: '',
    inter1stState: '', inter1stDistrict: '',
    tenthYear: '', tenthSchool: '', tenthPlace: '',
    tenthState: '', tenthDistrict: '',
    ninthYear: '', ninthSchool: '', ninthPlace: '',
    ninthState: '', ninthDistrict: '',
    eighthYear: '', eighthSchool: '', eighthPlace: '',
    eighthState: '', eighthDistrict: '',
    seventhYear: '', seventhSchool: '', seventhPlace: '',
    seventhState: '', seventhDistrict: '',
    sixthYear: '', sixthSchool: '', sixthPlace: '',
    sixthState: '', sixthDistrict: '',

    // EAPCET Details
    eapcetRegNo: '', eapcetHallTicket: '', eapcetRank: ''
  });

  const handleSubjectChange = (subject, field) => (e) => {
    setFormData(prev => ({
      ...prev,
      [subject]: {
        ...prev[subject],
        [field]: e.target.value
      }
    }));
  };

  const handleSimpleChange = (field) => (e) => {
    setFormData(prev => ({
      ...prev,
      [field]: e.target.value
    }));
  };

  const handleSubmit = () => {
    navigate('/report', { state: formData });
  };

  const renderSubjectFields = (subject, subjectName) => (
    <Box sx={{ mb: 3 }}>
      <Typography variant="body1" sx={{ fontWeight: 'bold' }}>{subjectName}</Typography>
      <Grid container spacing={2}>
        <Grid item xs={6} md={3}>
          <TextField
            label="1st Year Theory"
            fullWidth
            value={formData[subject].theory1stYear}
            onChange={handleSubjectChange(subject, 'theory1stYear')}
            InputProps={{ endAdornment: formData[subject].theory1stMax && `/ ${formData[subject].theory1stMax}` }}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="1st Year Max"
            fullWidth
            value={formData[subject].theory1stMax}
            onChange={handleSubjectChange(subject, 'theory1stMax')}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="2nd Year Theory"
            fullWidth
            value={formData[subject].theory2ndYear}
            onChange={handleSubjectChange(subject, 'theory2ndYear')}
            InputProps={{ endAdornment: formData[subject].theory2ndMax && `/ ${formData[subject].theory2ndMax}` }}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="2nd Year Max"
            fullWidth
            value={formData[subject].theory2ndMax}
            onChange={handleSubjectChange(subject, 'theory2ndMax')}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="Practicals"
            fullWidth
            value={formData[subject].practical}
            onChange={handleSubjectChange(subject, 'practical')}
            InputProps={{ endAdornment: formData[subject].practicalMax && `/ ${formData[subject].practicalMax}` }}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="Practical Max"
            fullWidth
            value={formData[subject].practicalMax}
            onChange={handleSubjectChange(subject, 'practicalMax')}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="Total"
            fullWidth
            value={formData[subject].total}
            onChange={handleSubjectChange(subject, 'total')}
            InputProps={{ endAdornment: formData[subject].totalMax && `/ ${formData[subject].totalMax}` }}
          />
        </Grid>
        <Grid item xs={6} md={3}>
          <TextField
            label="Total Max"
            fullWidth
            value={formData[subject].totalMax}
            onChange={handleSubjectChange(subject, 'totalMax')}
          />
        </Grid>
      </Grid>
    </Box>
  );

  return (
    <Box sx={{ pt: 4, px: 6, pb: 7 }}>
      <Typography variant="h5" gutterBottom align="center">
        APPLICATION FORM - Bachelor of Physiotherapy - 2025
      </Typography>

      <Grid container spacing={3}>
        {/* Advertisement Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Advertisement Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Ad. No." fullWidth value={formData.adNo} onChange={handleSimpleChange('adNo')} /></Grid>
